import React from 'react';
import { Box, Button, Typography } from '@mui/material';
import '../App.css';
import './styles/home.css'; 

const HomeText = () => {
	return (
		<div className='home_text_container'>
      <div className='home_text'>
        <p class="header-introduction"> I'm Nelson Rodriguez </p>
        <p class='header-information'>A<strong> Developer </strong> {/**<a class="company">@Meta</a>**/} and
            <a> </a>
            <a class="link-parchment" target="_blank" rel="noopener noreferrer" href="https://www.parchment.com/u/award/cdc63a097762a059103a9b3ce857a15e">CS Alum</a>
            <a> </a>
            <a class="link-gatech" target="_blank" rel="noopener noreferrer" href="https://www.cc.gatech.edu/">
              <strong class="georgia-tech">@Georgia Tech</strong>
            </a> 
        </p>

        <Box sx={{margin: '30px 0'}}>
          <Button variant='contained'size='large' onClick='/scrollToAboutMe' color='inherit'
            sx={{
              backgroundColor: 'var(--primary-color-dark)', // Set the background color to black
              color: 'white', // Set the text color to white
              '&:hover': {
                backgroundColor: 'grey', // Optional: change the background color on hover
              },
              fontFamily: 'var(--font-family-ibm-plex-mono)', // Keep your custom font family
            }}>
            <Typography variant='h6' align='center' fontWeight={600}>
              About Me
            </Typography>
          </Button>
        </Box>

      </div>
    </div>
	)
}

export default HomeText;
